from typing import List

# 我的解法 (二分查找法)
class Solution:
    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        left = 0
        right = 1
        while left < len(numbers) and right < len(numbers):
            left_val = numbers[left]
            right_val = target - left_val
            result = self.binary_search(numbers[left+1:], right_val)
            if result == -1:
                left += self.binary_search_v2(numbers[left+1:], left_val) + 1
            else:
                return [left + 1, left + result + 2]

    @staticmethod
    def binary_search(l, val):
        low, high = 0, len(l) - 1
        while low <= high:
            mid = low + (high - low) // 2
            if l[mid] == val:
                return mid
            elif l[mid] < val:
                low = mid + 1
            else:
                high = mid - 1
        return -1

    @staticmethod
    def binary_search_v2(l, val):
        # 寻找第一个大于val的数值的数
        low, high = 0, len(l) - 1
        while low < high:
            mid = low + (high - low) // 2
            if l[mid] == val:
                low = mid + 1
            else:
                high = mid
        return low


# 官方题解 双指针法 左右指针分别向内移动
class Solution:
    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        left, right = 0, len(numbers) - 1
        while left < right:
            val = numbers[left] + numbers[right]
            if val == target:
                return [left+1, right+1]
            elif val < target:
                left += 1
            else:
                right -= 1


